//  icons
import {
  FiLinkedin,
  FiInstagram,
  FiGithub,
  FiMail,
  FiMapPin,
  FiLink,
} from "react-icons/fi";


// projects images
import GameFindeX from "./assets/img/projects/videogames.jpg";
import movi from "./assets/img/projects/finderservice.jpg";
import portfolio from "./assets/img/projects/finderservice.jpg";

// skills images
import SkillImg1 from "./assets/img/skills/html5.png";
