  {
    name: "habilidades",
    href: "skills",
  },
  {
    name: "portfolio",
    href: "portfolio",
  },
  {
    name: "contacto",
    href: "contact",
  },
];

// social
export const social = [
  {
    name: "Linkedin",
    icon: <FiLinkedin />,
    href: "https://www.linkedin.com/in/nahir-maresca-63b028251/",
  },
  {
    name: "GitHub",
