    name: "CSS",
    type: "front",
    href: "https://www.w3schools.com/css/"
  },
  {
    image: SkillImg4,
    name: "React",
    type: "front",
    href: "https://es.reactjs.org/"
  },
  {
    image: SkillImg10,
    name: "Next JS",
    type: "front",
    href: "https://nextjs.org/"
