  },
  {
    image: SkillImg13,
    name: "MongoDB",
    type: "back",
    href: "https://www.mongodb.com/es"
  },

];

export const skillsOther = [
  {
    image: SkillImg3,
    name: "JavaScript",
    type: "other",
