  {
    image: SkillImg20,
    name: "Photoshop",
    type: "other",
    href: "https://www.adobe.com/ar/products/photoshop.html"
  },
];



// contact
export const contact = [
  {
    icon: <FiMail />,
    title: "¿Te interesa hacerme una consulta?",
